import React from "react";
import Question from "../Questions.jpg";


const HelpIcon = () => {
  var m = "Questions? <br/> Phone: 1 (800) 827-5722 TTY/TDD: 1-800-877-8339 Mon–Sun, 8 a.m to 8 p.m. (ET)"
  return (
    <div 
        class="HelpIcon" 
        data-html="true" 
        data-tooltip="test<br/>test">
        <img 
            src={Question} 
            alt="Question Mark"
            height="50"
            width="50"
        />
    </div>
  );
};

export default HelpIcon;
